import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Component } from 'react';
import { Button } from 'reactstrap';


class App extends Component() {
  constructor(props) {
    super(props);
    this.state = {
      listaBotones: [],
      playable: false
    };
  }
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <Button onClick={()=>this.jugar()}>Jugar</Button>
        </header>
      </div>
    );
  }
}

export default App;
